import React from 'react';
import Img5 from '../image/9.png';
import Img6 from '../image/10.png';
import Img7 from '../image/11.png';

function Team() {
    const textStyle = "text-sm text-white pt-10 leading-7"
    const headStyle = "text-yellow-400 text-3xl font-crimson"
    const headStyle1 = "text-gray-400 text-lg font-crimson"
    return (
        <div className='text-center'>
            <h3 class={headStyle1}>PROFESSIONAL</h3>
            <h1 class={headStyle}>OUR TEAM</h1>
            <div>
                <div>
                    <img src={img9} alt='' />
                </div>
            </div>
        </div>
    )
}

export default Team
